frappe.query_reports["Leave Application Report New"] = {
    "filters": [
        {
            "fieldname": "from_date",
            "label": __("From Date"),
            "fieldtype": "Date",
            "default": frappe.datetime.add_months(frappe.datetime.get_today(), -1),
            "reqd": 1,
        },
        // Add other filters as needed
    ],
    "onload": function (report) {
        // Format the 'Modified On' column
        report.page.fields_dict["Modified On"].get_query = function (doc, cdt, cdn) {
            return {
                "filters": [
                    ["Leave Application", "modified", ">", frappe.datetime.add_days(frappe.datetime.get_today(), -365)],
                ],
            };
        };
    },
};

